Johnny finds a website where people from all over the world offer to let travelers stay on their couches for free! It's called couch surfing; the cheapest way to travel. So he decides to visit Canada and when he arrives he's greeted with a pleasant surprise! It's Eva Angelina's house, his favorite pornstar of all time, and she's letting him stay on her couch!
